import React from 'react';
import logo from "../../img/logopart.jpg"
const PartElem = ({data}) => {
    return (
        <div className="part_shadow">
            <img src={logo}/>
            <div className="main_cont_info">
                <div className="main_cont_title">
                    <div className="main_cont_text">{data[0]}
                    </div>
                </div>
                <div className="main_cont_desc">
                    <div className="main_cont_desc_title">Описание
                    </div>
                    <div className="main_cont_desc_text">{data[1]}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PartElem;
